FileSystem.prototype.CloseFile = function(fd)
{
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0)
    {
        delete this.fileDescriptors[fd];
        return 0;
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.Read = function(fd, count)
{
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        var pos = fileDescriptor.pos;
        var sliceCount = Math.min(count, fileDescriptor.fileData.length - pos);
        if (sliceCount <= 0)
        {
            return -1;
        }
        
        var buffer = fileDescriptor.fileData.slice(pos, pos + sliceCount);
        fileDescriptor.pos += sliceCount;
        return buffer;
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.Seek = function(fd, offset, origin)
{
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        switch (origin)
        {
            case 0:// SEEK_SET
                fileDescriptor.pos = offset;
                return fileDescriptor.pos;
            case 1:// SEEK_CUR
                fileDescriptor.pos += offset;
                return fileDescriptor.pos;
            case 2:// SEEK_END
                throw "TODO: SEEK_END";
                break;
            default:
                throw "unhandled seek origin " + origin;
        }
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.Duplicate = function(fd)
{
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        var newfileDescriptor = this.CreateFileDescriptor(fileDescriptor.path);
        newfileDescriptor.fileData = fileDescriptor.fileData.slice(0);
        newfileDescriptor.pos = fileDescriptor.pos;
        return newfileDescriptor.id;
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.FdOpen = function(cpu, fd, mode)
{
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        if (fileDescriptor.filePtr != 0)
        {
            throw "FdOpen called twice?";
        }
        
        webcLog("fdopen '" + fileDescriptor.path + "' " + mode);
        
        var filePtr = cpu.heap.calloc(1, FILE_STRUCT_SIZE);
        if (filePtr != 0)
        {
            fileDescriptor.filePtr = filePtr;
            cpu.safe_write32(filePtr + 16, fd);// _file
        }
        
        return filePtr;
    }
    else
    {
        return 0;
    }
};

FileSystem.prototype.fclose = function(cpu, streamAddr, fpdPtr)
{
    cpu.validateAddress(streamAddr, FILE_STRUCT_SIZE);
    
    var fd = cpu.safe_read32(streamAddr + 16);
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        if (fileDescriptor.path == "main.exe")
        {
            compiledExe = fileDescriptor.fileData.slice(0);
        }
        
        if (fpdPtr)
        {
            cpu.validateAddress(fpdPtr, 4);
            cpu.safe_write32(fpdPtr, fd);
        }
        
        fileDescriptor.filePtr = 0;
        if (fileDescriptor.StreamLinked)
        {
            this.CloseFile(fd);
        }
        return 0;
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.fopen = function(cpu, filename, mode)
{
    webcLog("fopen '" + filename + "' " + mode);
    
    var fd = this.OpenFile(filename, 0);
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0)
    {
        fileDescriptor.StreamLinked = true;
        
        var filePtr = cpu.heap.calloc(1, FILE_STRUCT_SIZE);
        if (filePtr != 0)
        {
            fileDescriptor.filePtr = filePtr;
            cpu.safe_write32(filePtr + 16, fd);// _file
        }
        
        return filePtr;
    }
    else
    {
        return 0;
    }
};

FileSystem.prototype.fwrite = function(cpu, ptr, size, count, streamAddr)
{
    cpu.validateAddress(ptr, size * count);
    cpu.validateAddress(streamAddr, FILE_STRUCT_SIZE);
    
    var fd = cpu.safe_read32(streamAddr + 16);
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        var totalCount = size * count;
        for (var i = 0; i < totalCount; i++)
        {
            fileDescriptor.fileData[fileDescriptor.pos++] = cpu.virtualMemory[(ptr + i) - cpu.virtualMemoryAddress];
        }
        return totalCount;
    }
    else
    {
        return 0;
    }
};

FileSystem.prototype.fputc = function(cpu, character, streamAddr)
{
    cpu.validateAddress(streamAddr, FILE_STRUCT_SIZE);
    
    var fd = cpu.safe_read32(streamAddr + 16);
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        fileDescriptor.fileData[fileDescriptor.pos++] = character;
        return character;
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.fseek = function(cpu, streamAddr, offset, origin)
{
    cpu.validateAddress(streamAddr, FILE_STRUCT_SIZE);

    var fd = cpu.safe_read32(streamAddr + 16);
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        this.Seek(fd, offset, origin);
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.ftell = function(cpu, streamAddr)
{
    cpu.validateAddress(streamAddr, FILE_STRUCT_SIZE);
    
    var fd = cpu.safe_read32(streamAddr + 16);
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        return fileDescriptor.pos;
    }
    else
    {
        return -1;
    }
};

FileSystem.prototype.fgets = function(cpu, count, streamAddr)
{
    cpu.validateAddress(streamAddr, FILE_STRUCT_SIZE);
    
    var fd = cpu.safe_read32(streamAddr + 16);
    var fileDescriptor = this.fileDescriptors[fd];
    if (fileDescriptor && fd > 0 && fileDescriptor.fileData)
    {
        var pos = fileDescriptor.pos;
        count = Math.min(count - 1, fileDescriptor.fileData.length - pos);
        if (count <= 0)
        {
            return -1;
        }
        
        var result = [];
        for (var i = 0; i < count; i++)
        {
            fileDescriptor.pos++;
            var val = fileDescriptor.fileData[pos + i];
            if (val == 0x0A)
            {
                break;
            }
            result[i] = val;
        }
        return result;
    }
    else
    {
        return -1;
    }
};

var fileSystem = new FileSystem();